import Index from "./components/index";
import {BrowserRouter as Router,Route, Routes} from "react-router-dom";
import PrimeComponent from "./components/database";
function App() {

  return (


   <Router>
    <Routes>
      <Route path='/' element={<Index />} />
      <Route path='/' element={<PrimeComponent />} />

    </Routes>
   </Router>


  );
}

export default App;
